create table students (
	roll_number INT,
	name VARCHAR(50),
	father_name VARCHAR(50),
	mother_name VARCHAR(50),
	school_name VARCHAR(22),
	email VARCHAR(50),
	age INT,
	date_of_birth DATE,
	flo_marks INT,
	sle_marks INT,
	tls_marks INT,
	mth_marks INT,
	gsc_marks INT,
	ssc_marks INT,
	total_marks INT
);
